import React from 'react';

import './Board.css';
import {Cell} from '../cell/Cell';

export const Board = () => {
	const cellValue =['X','X','X','X','X','X','O','O','O','O'];
	const cells =cellValues.map((value, index) =>
	<Cell value={value} />)
  return (<>
      	<div id="board">
			< Cell value="X" canHighlight ={true}/>
			< Cell value="X" canHighlight ={true}/>
			< Cell value="X" canHighlight ={true}/>
			< Cell value="X" canHighlight ={true}/>
			< Cell value="X" canHighlight ={true}/>
			< Cell value="O" canHighlight ={false}/>
			< Cell value="O" canHighlight ={false}/>
			< Cell value="O" canHighlight ={false}/>
			< Cell value="O" canHighlight ={false}/>
      	</div>
  </>
  );
}
